    <!-- saved from url=(0014)about:internet -->
    <meta content="text/html; charset=windows-1252"
      http-equiv="Content-Type">
    <link id="stylesheet" rel="stylesheet"
      href="/opt/ftb/tree-builder/css/ftb.css" type="text/css">
    <script id="ftLoader" type="text/javascript">
      var i = location.href.lastIndexOf("/tree/");
      if (i != -1) {
          var rt = location.href.substring(0, i);
      
          var css = document.getElementById("stylesheet");
          css.href = rt+"/ftb/dist/css/ftb.css";
      
          var script1 = document.createElement('script');
          script1.src = rt+"/ftb/dist/js/ftb.js";
          document.head.appendChild(script1);
      } else {
          console.error("Failed to find the 'tree' root directory in URL path");
      }
  </script>
